import React from 'react';
import styled from 'styled-components';
import { Title } from '../auth-info';

const Wrapper = styled.div`
  width: 844px;
  margin: 130px auto 50px;
`

export const Info = () => {
  return <Wrapper>
    <Title>
      Info
    </Title>
  </Wrapper>
}
